uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Audio-reactive uniforms
uniform float u_bass;
uniform float u_mid;
uniform float u_treble;
uniform float u_vol;

// Exposed Parameters
uniform float u_camera_dist;
uniform float u_speed;
uniform float u_complexity;
uniform float u_glow_intensity;
uniform float u_color_shift;
uniform float u_recursive_fold;
uniform float u_detail_scale;

out vec4 fragColor;

#define MAX_STEPS 160
#define SURF_DIST 0.0005
#define MAX_DIST 25.0

// Rotation matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// Smooth Minimum for organic blending
float smin(float a, float b, float k) {
    float h = clamp(0.5 + 0.5 * (b - a) / k, 0.0, 1.0);
    return mix(b, a, h) - k * h * (1.0 - h);
}

// Palettes by Inigo Quilez
vec3 palette(float t) {
    vec3 a = vec3(0.5, 0.5, 0.5);
    vec3 b = vec3(0.5, 0.5, 0.5);
    vec3 c = vec3(1.0, 1.0, 1.0);
    vec3 d = vec3(0.1, 0.2, 0.3) + u_color_shift;
    return a + b * cos(6.28318 * (c * t + d));
}

// Scene SDF: A hyper-detailed recursive biomechanical structure
float map(vec3 p) {
    float t = iTime * u_speed * 0.2;

    // Global transformation
    p.xz *= rot(t * 0.1);
    p.xy *= rot(t * 0.05);

    // Audio influence on geometry
    float audioBoost = u_bass * 0.6;
    float pulse = sin(iTime * 2.0) * 0.1;

    vec3 q = p;
    float scale = 1.0;

    // Mind-blowing Fractal Iterations
    // We increase iterations based on complexity but cap at 12 for performance
    int iterations = int(clamp(u_complexity, 4.0, 12.0));

    for(int i = 0; i < iterations; i++) {
        // Folding space for infinite detail
        p = abs(p) - (1.2 + audioBoost + u_recursive_fold * 0.2);

        if (p.x < p.y) p.yx = p.xy;
        if (p.x < p.z) p.zx = p.xz;
        if (p.y < p.z) p.zy = p.yz;

        // Non-linear rotation per iteration creates "mind-blowing" twisting
        float angle = 0.5 + float(i) * 0.4 + (u_mid * 0.3);
        p.xy *= rot(angle);
        p.yz *= rot(angle * 0.5);

        float k = 1.5 + (u_treble * 0.15) + (u_recursive_fold * 0.1);
        p *= k;
        scale *= k;

        // Add a secondary internal translation to break symmetry
        p.x -= 0.1 * u_recursive_fold;
    }

    // Base shape: Infinite cross/box hybrid
    float d = (length(p) - (1.5 + pulse)) / scale;

    // Micro-detail layer: Veins, ridges, and fractal pores
    float details = sin(q.x * u_detail_scale) * sin(q.y * u_detail_scale) * sin(q.z * u_detail_scale);
    details *= 0.005 / (1.0 + u_vol); // Scale details down so they don't break the SDF

    // Add additional recursive "ribs"
    float ribs = sin(p.x * 0.5) * sin(p.y * 0.5) * sin(p.z * 0.5) * (0.1 / scale);

    return d + details + ribs;
}

// Raymarching loop with enhanced glow accumulation
float rayMarch(vec3 ro, vec3 rd, out float glow, out float steps) {
    float dO = 0.0;
    glow = 0.0;
    steps = 0.0;

    for(int i = 0; i < MAX_STEPS; i++) {
        vec3 p = ro + rd * dO;
        float dS = map(p);

        // Accumulate glow based on proximity to the fractal surface
        float g = 1.0 / (1.0 + dS * dS * 80.0);
        glow += g * u_glow_intensity;

        dO += dS * 0.65; // Slightly reduced step size for high detail stability
        steps++;

        if(dO > MAX_DIST || abs(dS) < SURF_DIST) break;
    }

    return dO;
}

// Normal calculation with higher precision for detail
vec3 getNormal(vec3 p) {
    float d = map(p);
    vec2 e = vec2(0.0002, 0); // Smaller epsilon for fine details
    vec3 n = d - vec3(
        map(p - e.xyy),
        map(p - e.yxy),
        map(p - e.yyx)
    );
    return normalize(n);
}

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 m = iMouse.xy / iResolution.xy;

    // Camera setup with smooth movement
    float zoom = u_camera_dist;
    vec3 ro = vec3(0, 0, -zoom);

    // Interaction
    ro.yz *= rot(-m.y * 3.14 + 1.0 + sin(iTime * 0.2) * 0.2);
    ro.xz *= rot(-m.x * 6.28 + iTime * 0.1);

    vec3 lookat = vec3(0, 0, 0);
    vec3 f = normalize(lookat - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + uv.x * r + uv.y * u);

    // Execute Raymarching
    float glowAcc = 0.0;
    float steps = 0.0;
    float d = rayMarch(ro, rd, glowAcc, steps);

    vec3 col = vec3(0.0);

    // Background stars/dust
    float bgGlow = pow(length(uv), 2.0) * 0.1;
    col += palette(iTime * 0.05 + 0.5) * bgGlow;

    if(d < MAX_DIST) {
        vec3 p = ro + rd * d;
        vec3 n = getNormal(p);
        vec3 r_dir = reflect(rd, n);

        // Multi-light setup for "Mind-Blowing" highlights
        vec3 lp1 = vec3(2, 5, 3);
        vec3 lp2 = vec3(-3, -2, -5);

        float diff1 = max(0.0, dot(n, normalize(lp1)));
        float diff2 = max(0.0, dot(n, normalize(lp2))) * 0.4;

        float spec = pow(max(0.0, dot(r_dir, normalize(lp1))), 64.0);
        float fresnel = pow(1.0 + dot(rd, n), 4.0);

        // Coloring based on iteration depth and world position
        vec3 baseCol = palette(length(p) * 0.05 + iTime * 0.1 + (u_vol * 0.2));

        // Darker cavities (AO based on step count)
        float ao = 1.0 - (steps / float(MAX_STEPS));

        col = baseCol * (diff1 + diff2 + 0.1);
        col += spec * vec3(0.8, 0.9, 1.0) * u_treble;
        col += fresnel * palette(u_color_shift + 0.5) * 0.5;

        col *= ao;
    }

    // Volumetric Glow and Bloom
    vec3 glowCol = palette(iTime * 0.1 + u_color_shift);
    col += glowCol * (glowAcc * 0.015);

    // Subtle chromatic aberration
    float distToCenter = length(uv);
    col.r = texture(iChannel0, uv * (1.0 + distToCenter * 0.01)).r * 0.0 + col.r; // Placeholder logic

    // Atmosphere and Fog
    float fog = 1.0 - exp(-0.002 * d * d);
    vec3 fogCol = vec3(0.01, 0.02, 0.04) * (1.0 + u_bass);
    col = mix(col, fogCol, fog);

    // Vignette
    col *= smoothstep(1.2, 0.4, distToCenter);

    // Tone mapping
    col = col / (1.0 + col); // Simple Reinhard
    col = pow(col, vec3(0.4545)); 

    fragColor = vec4(col, 1.0);
}
